var parseValue = function parseValue(_parseValue) {
  var stringified = _parseValue.toString();

  var hasDecimal = /\.\d/.test(stringified);
  return hasDecimal ? parseFloat(stringified) : parseInt(stringified, 10);
};

export default parseValue;
